const easing = [0.6, -0.05, 0.01, 0.99];

const animationName = {
  initial: {
    y: '-100px',
    opacity: 1
  },
  animate: {
    y: '-10px',
    opacity: 1,
    transition: {
      duration: 0.9,
      ease: easing,
      delay: 0,
    },
  },
  exit: { 
    y: '-100px',
    opacity: 1
  }
}

export {easing, animationName}
